import React, { Component } from "react";

class TodoItem extends Component {
 
constructor(props) {
	super(props);
	this.ListTasks=this.ListTasks.bind(this);

}

addTask(task){


	return <li onClick={() => console.log('kliknieto mnie')} key={task.key}>{task.text}</li>

}



	render(){
		var todoEntity=this.props.entries;
		var getItems=todoEntity.map(this.addTask)
		return (

		<ul className="theList">
		{getItems}
	</ul>

		);
	}

}

export default TodoItem;
